import { StyleSheet } from "react-native";
import theme from "./theme";

const componentsStyle = StyleSheet.create({
    listItem: {
        backgroundColor: theme.background2,
        marginVertical: 10,
        borderRadius: 5,
        color: theme.fontColor1,
        paddingHorizontal: 15,
        paddingVertical: 10,
        fontSize: 16
    },
    labelInputText: {
        color: theme.fontColor1,
        fontSize: 16
    },
    labelInput: {
        backgroundColor: theme.background2,
        paddingVertical: 5,
        paddingHorizontal: 10,
        marginTop: 5,
        borderRadius: 5,
        color: theme.fontColor1,
        outlineColor: theme.background2,
        marginBottom: 10
    },
    button: {
        flexDirection: "row",
        backgroundColor: theme.primary1,
        marginTop: 30,
        borderRadius: 5,
        paddingVertical: 5,
        paddingHorizontal: 15,
        alignItems: "center"
    },
    textButton: {
        color: theme.fontColor1,
        marginLeft: 10,
        fontSize: 16
    },
});

export default componentsStyle;
